-- nba_assistant_coaches table
drop table if exists nba_assistant_coaches;
CREATE TABLE nba_assistant_coaches (
    staff_id INT,
    first_name VARCHAR(255) NOT NULL,
    last_name VARCHAR(255) NOT NULL,
    team_id INT,
	season_id VARCHAR(255),
    primary key (staff_id, first_name, last_name, team_id, season_id),
    FOREIGN KEY (team_id)
        REFERENCES nba_teams (team_id)
        ON UPDATE CASCADE ON DELETE RESTRICT,
	FOREIGN KEY (season_id)
        REFERENCES nba_season (season_id)
        ON UPDATE CASCADE ON DELETE RESTRICT
);
