-- procedure that gets all teams
drop procedure if exists get_all_teams;
delimiter $$
create procedure get_all_teams()
begin
	select distinct nba_teams.team_id, nba_teams.full_name, nba_teams.conference, year_founded, city, state
    from nba_teams inner join team_season inner join arenas 
    on nba_teams.team_id = team_season.team_id and team_season.arena_name = arenas.arena_name;
end $$
delimiter ;
call get_all_teams();

-- procedure to get all games in a season (need to get game data first)
drop procedure if exists get_season_games;
delimiter $$
create procedure get_season_games(in season_id_p varchar(255))
begin
	select game_id, home_team_id, home_team_name, away_team_id, away_team_name, home_team_score, away_team_score, game_date, stadium, city, state
    from nba_games;
end $$
delimiter ;
call get_season_games('2022-23');

-- procedure to get season standings in a season (haven't gotten the data for this yet)
