delimiter $$
create procedure get_season_standings(in season_id_p varchar(255), in conference varchar(255))
begin
    select team_id, team_name, wins, losses, win_percentage
    from nba_games;
end $$
delimiter ;
call get_season_standings('2022-23','Western');

